		    var json = null;

			    return json;
			    })(); 





console.log(json_data);
var bugs=[],easy=[],med=[],hard=[],del=[],add=[],com=[],users=[];

{

				    com.push([json_data [i]["scores"]["commits"]]);
				        users.push([json_data [i]["user"]]);


}
console.log(users);
</script>
